import React from 'react';
import './myStyle.css'
import { MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBContainer, MDBMask, MDBView } from 'mdbreact';
import { useSelector } from 'react-redux';
export default function Home(){
  let c= useSelector((store) => {return store.Companies.company }); 


    return(
        <div className='home'>
        <h1><strong></strong></h1>
          <p><strong> מטרת הקמת האתר נועדה על מנת לקהל על משתמשיה</strong></p>
          <p><strong> אנו צוות האתר מודעים לקושי של משתמשינו (לרוב מנהלי חברות) לעקוב אחר לקוחתיהם</strong></p>
          <p><strong> דבר זה צורך קריאה של מיילים שעות של עבודה ובזבוז כסף וכח אדם</strong></p>
          <p><strong> אתרינו מציע ממשק קל ונוח למשתמש אשר בלחיצת כפתור יוכל לחסוך רבות</strong></p>
          <p><strong> אנו מקווים שתהיה לך חווית גלישה טובה  ומועילה ביותר</strong></p>
        </div>
    )
}
